agents.activites:
Activités de terrain 
Organisation, installation et maintenance de dispositifs de mesure, d’observation et d’expérimentation dans le milieu continental et dans le cadre de participation à des missions côtières en plongée subaquatique. 

Activités de laboratoire 
Suivi, maintenance et amélioration des équipements du laboratoire de Palynologie ; 
Préparation des échantillons palynologiques en routine pour analyses ultérieures à EPOC ou pour expédition à d’autres laboratoires nationaux et internationaux et adaptation du traitement palynologique aux différents types de matériaux ; 
Surveillance de la qualité, la cohérence et la traçabilité des données palynologiques 
Gestion des commandes de consommables et de matériel de laboratoire ; 

Activités de médiation scientifique 
Création, suivi et maintenance de sites web sur la thématique des paléoclimats ;
Organisation d’expositions de vulgarisation scientifique sur les paléoclimats
